import { Switch, Route } from 'react-router-dom';
import {lazy,Suspense} from 'react';

import Home from './Paginas/Home/Home';
import Lojas from './Paginas/Lojas/Lojas';
import Contatos from './Paginas/Contato/Contatos';
import Produtos from './Paginas/Produtos/Produtos';
import Relatorio from './Paginas/Resposta/Relatorio'


const  home = lazy(() => import("./code-splitting/Home"));
const  produtos = lazy(() => import('./code-splitting/Produtos'));
const  lojas = lazy(() => import('./code-splitting/Lojas'));
const  contato = lazy(() => import('./code-splitting/Contato'));


function Rotas() {
    return (
        <Suspense fallback={<div> Carregando....</div>}>
            <Switch>
                <Route exact path="/" component={Home}/>
                <Route exact path="/produtos" component={Produtos}/>
                <Route exact path="/lojas" component={Lojas}/>
                <Route exact path="/contatos" component={Contatos}/>
                <Route exact patch="/relatorio" component={Relatorio}/>
            </Switch>
        </Suspense>
    );
}

export default Rotas;
